function setCookie(e,o,t){null!=t&&""!=t||(t=300);var i=new Date;i.setTime(i.getTime()+24*t*60*60*1e3),document.cookie=e+"="+o+"; path=/;expires="+i.toGMTString()}function getCookie(e){var o,t=new RegExp("(^| )"+e+"=([^;]*)(;|$)");return(o=document.cookie.match(t))?o[2]:null}function getAllCookie(){return document.cookie}function clearCookie(e){setCookie(e,"",-1)}function delCookie(e){var o=new Date;o.setTime(o.getTime()-1);var t=getCookie(e);null!=t&&(document.cookie=e+"="+t+"; path=/;expires="+o.toGMTString())}